import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <body>
        <form>
          <label>
            <input type="checkbox" name="check-1" id/>
            Select all
          </label>
        </form>
      </body>
    </div>
  );
}

export default App;
